import React, { Component } from 'react';
import {Route} from 'react-router-dom';
import ExamplePage from './ExamplePage'

class Nav extends Component {
    render() {
        return (
            <div>
                <Route path="/example-page"  component={ExamplePage}/>
            </div>
        );
    }
}

export default Nav;
